pub enum AsepriteParseError {

    /// The input data was malformed. String contains detailed message.
    InvalidInput(String),

    /// The input data was correct, but uses a feature that is not supported by
    /// this version of `asefile`. String contains detailed message.
    UnsupportedFeature(String),

    /// An IO error occured. Also includes errors where the input was shorter
    /// than expected.
    IoError(io::Error),
}

pub enum PixelFormat {

    /// Red, green, blue, and alpha with 8 bits each.
    Rgba,

    /// 8 bit grayscale and 8 bit alpha,
    Grayscale,

    /// Indexed color. Color is determined by palette.
    /// The `transparent_color_index` is used to indicate a
    /// transparent pixel in any non-background layer.
    #[allow(missing_docs)]
    Indexed {
        transparent_color_index: u8,
    },
}

pub enum LayerType {

    /// A regular image layer. This is the normal layer type.
    Image,

    /// A layer that groups other layers and does not contain any image data.
    /// In Aseprite these are represented by a folder icon.
    Group,
}

pub enum AnimationDirection {

    /// Start at `from_frame` and count up to `to_frame`.
    Forward,

    /// Start at `to_frame` and count down to `from_frame`.
    Reverse,

    /// Start at `from_frame`, count up to `to_frame`, then back down to `from_frame`.
    PingPong,
}
